import React, { useEffect, useState } from "react";

function Pay() {
  let [htmlFileString, setHtmlFileString] = useState();

  async function fetchHtml() {
    setHtmlFileString(
      await (
        await fetch(
          `https://drive.google.com/file/d/1cUOleZSU1PrekWeQIbJp4JMxLOx4NDK3/view?usp=sharing`
        )
      ).text()
    );
  }
  useEffect(() => {
    fetchHtml();
  }, []);

  return (
    <div className="App">
      <div dangerouslySetInnerHTML={{ __html: htmlFileString }}></div>
    </div>
  );
}

export default Pay;
